import React from "react";
import INFO from "../data/user";

function article_1() {
	return {
		date: "January 2025",
		title: "Digitalization in University-Industry Collaboration",
		description:
			"Exploring how digital transformation reshapes academic-industry partnerships, balancing innovation, research, and industrial demands.",
		keywords: [
			"Digitalization in University-Industry Collaboration",
			"Rashelli",
			"Rasheli NJ",
			"Rasheli Jayalath",
		],
		style: `
				.article-content {
					display: flex;
					flex-direction: column;
					align-items: center;
				}

				.artImage {
					align-self: center;
					outline: 2px solid red;
				}

				.paragraph {
					text-align: justify;
				}
				`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph">{INFO.articles.article1_intro}</div>
					<img
						src="ART1.png"
						alt=""
						className="artImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}

function article_2() {
	return {
		date: "7 May 2023",
		title: "Artificial Intelligence in Healthcare",
		description:
			"AI is transforming the healthcare industry, from improving patient outcomes to streamlining operations. Discover the latest applications of this game-changing technology.",
		style: ``,
		keywords: [
			"Artificial Intelligence in Healthcare",
			"Tharindu",
			"Tharindu N",
			"Tharindu Nayanajith",
		],
		body: (
			<React.Fragment>
				<h1>Content of article 2</h1>
			</React.Fragment>
		),
	};
}

const myArticles = [article_1, article_2];

export default myArticles;
